propDescriptions.getItemAriaLabel:
Accepts a function which returns a string value that provides a user-friendly name for the current page.

For localization purposes, you can use the provided <a href="/guides/localization/">translations</a>.

@param {string} type The link or button type to format (&#39;first&#39; | &#39;last&#39; | &#39;next&#39; | &#39;previous&#39;).
@returns {string}
@default function defaultGetAriaLabel(type) {
  return <code>Go to ${type} page</code>;
}

propDescriptions.labelDisplayedRows:
Customize the displayed rows label. Invoked with a <code>{ from, to, count, page }</code>
object.

For localization purposes, you can use the provided <a href="/guides/localization/">translations</a>.
@default function defaultLabelDisplayedRows({ from, to, count }) {
  return <code>${from}-${to} of ${count !== -1 ? count : </code>more than ${to}<code>}</code>;
}

propDescriptions.onPageChange:
Callback fired when the page is changed.

@param {object} event The event source of the callback.
@param {number} page The page selected.
